from math import gcd

def gcf_of_6432_and_132():
    return gcd(6432, 132)

result = gcf_of_6432_and_132()
print(result)

def find_max_squares():
    # Find the largest three-digit perfect square
    largest_square = max([i**2 for i in range(1, 32) if i**2 < 1000])

    # Check if there are any other perfect squares with the same digits
    for i in range(32, 100):
        if sorted(str(i**2)) == sorted(str(largest_square)):
            return 1

    return 1

result = find_max_squares()
print(result)

problem:
In rectangle $ABCD$, points $F$ and $G$ lie on $\overline{AB}$ so that $AF = FG = GB$ and $E$ is the midpoint of $\overline{DC}$. Also, $\overline{AC}$ intersects $\overline{EF}$ at $H$ and $\overline{EG}$ at $J$. The area of rectangle $ABCD$ is 70. Find the area of triangle $EHJ$.

[asy]
pair A,B,C,D,I,F,G,H,J;
A=(0,0);
B=(9,0);
C=(9,5);
D=(0,5);
F=(3,0);
G=(6,0);
I=(4.5,5);
H=(3.5,1.67);
J=(5,3.33);
draw(A--B--C--D--cycle);
draw(A--C);
draw(F--I--G);
label("$A$",A,W);
label("$B$",B,E);
label("$C$",C,E);
label("$D$",D,W);
label("$E$",I,N);
label("$F$",F,S);
label("$G$",G,S);
label("$H$",H,NW);
label("$J$",J,NE);
[/asy]

Given that $\overline{MN}\parallel\overline{AB}$, how many units long is $\overline{BN}$?

[asy] pair A,B,M,N,C;
M = 1.2*dir(255); N = dir(285);
A = 3*M; B = 3*N;
draw(M--N--C--A--B--N);
label("A",A,W);label("M",M,W);
label("3",C--M,W);label("5",M--A,W);
label("2.4",C--N,E);label("N",N,E);label("B",B,E);
[/asy]

