from sympy import symbols, Eq, solve

def find_dimensions():
    x, y = symbols('x y')
    area = 70
    equation = Eq(x * y, area / 15)

    for x_value in range(1, 100):
        for y_value in range(1, 100):
            if equation.subs({x: x_value, y: y_value}):
                return x_value, y_value

x, y = find_dimensions()
print(f"x = {x}, y = {y}")

